// Funzione per aggiungere la barra di editing al sito
function addEditingBar() {
	$("body").append('<div class="editing_bar_container"></div>');
	$(".editing_bar_container").html('<div class="editing_bar_inner_container"></div>');
	$(".editing_bar_inner_container").html('<div class="col-xs-12 editing_button_container"><a class="savePageBlockAction btn btn-default" href="#">Salva modifiche</a><span class="msgContainerAction"></span></div>');

	return true;
}

$(document).ready(function(){
	$('.froala-editor-html').froalaEditor(froalaEditorHtml).on('froalaEditor.image.error', function (e, editor, error, response) {
		// Bad link.
		if (error.code == 1) { alert("Bad link"); }
		// No link in upload response.
		else if (error.code == 2) { alert("No link in upload response"); }
		// Error during image upload.
		else if (error.code == 3) { alert("Error during image upload"); }
		// Parsing response failed.
		else if (error.code == 4) { alert("Parsing response failed"); }
		// Image too text-large.
		else if (error.code == 5) { alert("Image too text-large"); }
		// Invalid image type.
		else if (error.code == 6) { alert("Invalid image type"); }
		// Image can be uploaded only to same domain in IE 8 and IE 9.
		else if (error.code == 7) { alert("Image can be uploaded only to same domain in IE 8 and IE 9"); }
		// Response contains the original server response to the request if available.
	});

	$('.froala-editor-inline').froalaEditor(froalaEditorInline);

	// click per salvare le modifiche della pagina
	$(document).on("click", ".savePageBlockAction", function(){
		// destroy di tutti gli edito html
		destroy_html_editor()
		// salvo i valori dei blocchi della pagina corrente
		savePageBlocks();
		// init di tutti gli edito html
		init_html_editor();

		return false;
	});

	// aggiungo la barra di editing
	addEditingBar();
});

// Function to destroy all html editors
function destroy_html_editor() {
	$('.froala-editor-html').froalaEditor('destroy');
	$('.froala-editor-inline').froalaEditor('destroy');

	return true;
}

// Function to init all html editors
function init_html_editor() {
	$('.froala-editor-html').froalaEditor(froalaEditorHtml).on('froalaEditor.image.error', function (e, editor, error, response) {
		// Bad link.
		if (error.code == 1) { alert("Bad link"); }
		// No link in upload response.
		else if (error.code == 2) { alert("No link in upload response"); }
		// Error during image upload.
		else if (error.code == 3) { alert("Error during image upload"); }
		// Parsing response failed.
		else if (error.code == 4) { alert("Parsing response failed"); }
		// Image too text-large.
		else if (error.code == 5) { alert("Image too text-large"); }
		// Invalid image type.
		else if (error.code == 6) { alert("Invalid image type"); }
		// Image can be uploaded only to same domain in IE 8 and IE 9.
		else if (error.code == 7) { alert("Image can be uploaded only to same domain in IE 8 and IE 9"); }
		// Response contains the original server response to the request if available.
	});

	$('.froala-editor-inline').froalaEditor(froalaEditorInline);

	return true;
}

// TODO
// Funzione per salvare tutti i blocchi nella pagina
// itero su tutti gli elementi che hanno la classe "blockToSaveAction" e salvo il contenuto
// nel relativo "data-block-code" del sito con il dominio corrente
function savePageBlocks() {
	var keyValAjaxParams = "";
	$(".blockToSaveAction").each(function() {
		var block_key = $(this).data("blockCode");
		var block_val = $(this).html();

		// console.log(block_key + " " + block_val);
		keyValAjaxParams += block_key + "=" + block_val + "&"
	});

	var saveBlockValueAction = customAjaxAction;
	// serialize form
	saveBlockValueAction.setAjaxCallParams(keyValAjaxParams);
	// setting action name
	saveBlockValueAction.setActionName("save_site_block");
	// success callback function
	var successCallback = function(jsonResponse) {
		// open success bootstrap modal
		$(".msgContainerAction").html('<span class="block_msg show_msg_animated savedMsgAction">Pagina salvata con successo</span>');
	};
	saveBlockValueAction.setAjaxSuccessCallbackFunction(successCallback);
	// error callback function
	var errorCallback = function(jsonResponse) {
		alert("(ERRORE) -> " + jsonResponse.msg);
	};
	saveBlockValueAction.setAjaxErrorCallbackFunction(errorCallback);
	// perform ajax call to add favorite
	saveBlockValueAction.performAjaxAction();

	return true;
}

